import Singlecat from "./SingleCat";

const cats = [
  { name: "Cheetah", latinName: "Acinonyx jubatus", image: "data:image/webp;base64," },
  { name: "Cougar", latinName: "Puma concolor", image: "data:image/webp;base64," },
  { name: "Jaguar", latinName: "Panthera onca", image: "data:image/jpeg;base64," },
  { name: "Leopard", latinName: "Panthera pardus", image: "data:image/jpeg;base64," },
  { name: "Lion", latinName: "Panthera leo", image: "data:image/jpeg;base64," },
  { name: "Snow leopard", latinName: "Panthera uncia", image: "data:image/jpeg;base64," },
  { name: "Tiger", latinName: "Panthera tigris", image: "data:image/jpeg;base64,"}
];

const BigCats = () => {
 
    return (
        <>
    <ul>
      {cats.map((cats, index) => (
        <li key={index}>
          <h2>{cats.name}</h2>
          <p>{cats.latinName}</p>
        </li>
      ))}
    </ul>
    <div>
        {cats.map((cat, index) => (
            <Singlecat ley={index} cat={cat} />
        ))}
    </div>
    </>
  );
};

export default BigCats;
